def find_winner(A):
    n = len(A)
    dp = [[0] * n for _ in range(n)]

    for i in range(n):
        dp[i][i] = 1

    for length in range(2, n + 1):
        for i in range(n - length + 1):
            j = i + length - 1
            if A[i] < A[j]:
                dp[i][j] = 2
            else:
                dp[i][j] = 1

            for k in range(i + 1, j):
                if A[i] < A[k]:
                    dp[i][j] = max(dp[i][j], dp[i][k] + dp[k][j])

    return "Alice" if dp[0][n - 1] % 2 == 1 else "Bob"
